import './LandingPage.css';
import Register from '../UserMgmt/Registeration'
import ProductPage from './ProductPage'
import SignIn from '../UserMgmt/SignIn'
import { useState } from 'react'
import logo from 'D:/Practice/ReactJS/authenticationsystem/src/images/jb_logo.png'
import mainHeader  from '../Common/Header';

function LandingPage(props) {
    const [State, setState] = useState("Registerbtn");
    const Showsignup = () => {
        setState("Register");
    }
    const Showsignin = () => {
        setState("Signin");
    }
    function ChangeState(parameter) {
        // setState(parameter);
        props.IsLandingPage("MasterLanding");
    }
    return (
        <div className="LandingContent">
            <mainHeader />
            {/* <div className="header">
                <div className="header-left-component">
                    <div className="divlogo">
                        <span>JB</span>
                    </div>
                </div>
                <div className="header-right-component">
                    <div className="header-right-component-right">
                        <div className="dvSignIn">
                            <label><a href="#" onClick={Showsignin}>Sign In</a></label>
                        </div>
                        <div className="dvSignUp">
                            <label><a href="#" onClick={Showsignup}>Sign Up</a></label>
                        </div>
                    </div>
                </div>
            </div> */}
            <div className="content">
                {State == "Register" &&
                    <Register IsRegister={ChangeState}></Register>
                }
                {State == "Signin" &&
                    <SignIn IsSignIn={ChangeState}></SignIn>
                }
                {State == "ProductPage" &&
                    <ProductPage IsSignIn={ChangeState}></ProductPage>
                }
            </div>
        </div>
    );
}
export default LandingPage;
